	public static Image createImage(string imagename, int ZoomLevel)
	{
		if (imagename != "logoGameScr" && imagename != "imgTitle")
		{
			if (File.Exists(imagename))
			{
				byte[] inArray = File.ReadAllBytes(imagename);
				string s = Convert.ToBase64String(inArray);
				Texture2D texture2D = new Texture2D(2, 2);
				texture2D.LoadImage(Convert.FromBase64String(s));
				return Image.createImage(ScaleTexture(texture2D, texture2D.width / (2 / ZoomLevel), texture2D.height / (2 / ZoomLevel)).EncodeToPNG());
			}
			return null;
		}
		string s2 = imageString(imagename, ZoomLevel);
		Texture2D texture2D2 = new Texture2D(2, 2);
		texture2D2.LoadImage(Convert.FromBase64String(s2));
		return Image.createImage(texture2D2.EncodeToPNG());
	}

	public static Image createUI(string imagename)
	{
		string s = imageString(imagename);
		Texture2D texture2D = new Texture2D(2, 2);
		texture2D.LoadImage(Convert.FromBase64String(s));
		return Image.createImage(ScaleTexture(texture2D, texture2D.width / (2 / mGraphics.zoomLevel), texture2D.height / (2 / mGraphics.zoomLevel)).EncodeToPNG());
	}

	public static Texture2D ScaleTexture(Texture2D source, int targetWidth, int targetHeight)
	{
		Texture2D texture2D = new Texture2D(targetWidth, targetHeight, source.format, mipmap: true);
		Color[] pixels = texture2D.GetPixels(0);
		float num = 1f / (float)targetWidth;
		float num2 = 1f / (float)targetHeight;
		for (int i = 0; i < pixels.Length; i++)
		{
			pixels[i] = source.GetPixelBilinear(num * ((float)i % (float)targetWidth), num2 * Mathf.Floor(i / targetWidth));
		}
		texture2D.SetPixels(pixels, 0);
		texture2D.Apply();
		return texture2D;
	}
